const list = document.getElementById('list');
const tpl = document.getElementById('cardTpl');

function renderCards(filter = '') {
  list.innerHTML = '';
  const q = filter.trim().toLowerCase();
  const filtered = cars.filter(c => {
    if (!q) return true;
    return (c.title + ' ' + c.desc + ' ' + c.tags.join(' ')).toLowerCase().includes(q);
  });

  if (filtered.length === 0) {
    list.innerHTML = '<div style="color:var(--muted);padding:20px">No results — try a broader search.</div>';
    return;
  }

  filtered.forEach(c => {
    const clone = tpl.content.cloneNode(true);
    clone.querySelector('.thumb').src = c.img;
    clone.querySelector('h3').textContent = c.title;
    clone.querySelector('.desc').textContent = c.desc;

    const tagsEl = clone.querySelector('.tags');
    c.tags.forEach(t => {
      const span = document.createElement('span');
      span.className = 'tag';
      span.textContent = t;
      tagsEl.appendChild(span);
    });

    const card = clone.querySelector('.card');
    card.addEventListener('click', () => openPage(c));
    list.appendChild(clone);
  });
}

function filterCards() {
  const q = document.getElementById('search').value;
  renderCards(q);
}

function openPage(car) {
  const html = `
    <div style="position:fixed;inset:0;background:rgba(2,6,23,0.75);display:flex;align-items:center;justify-content:center;z-index:9999">
      <div style="width:92%;max-width:900px;background:#071428;padding:18px;border-radius:12px;border:1px solid rgba(255,255,255,0.04);box-shadow:0 18px 50px rgba(2,6,23,0.8);">
        <div style="display:flex;gap:14px">
          <img src="${car.img}" style="width:320px;height:200px;object-fit:cover;border-radius:8px" />
          <div style="flex:1">
            <h2 style="margin:0 0 8px">${car.title}</h2>
            <p style="color:var(--muted);margin:0 0 10px">${car.desc}</p>
            <div style="margin-top:10px">${car.tags.map(t=>`<span class="tag">${t}</span>`).join(' ')}</div>
            <div style="margin-top:18px;color:var(--muted);font-size:13px">Source images: curated from public web sources.</div>
          </div>
        </div>
        <div style="text-align:right;margin-top:12px"><button id="closeBtn" style="padding:8px 12px;border-radius:8px;border:none;background:var(--accent);color:#081018;font-weight:600;cursor:pointer">Close</button></div>
      </div>
    </div>
  `;
  
  const wrapper = document.createElement('div');
  wrapper.innerHTML = html;
  document.body.appendChild(wrapper);
  wrapper.querySelector('#closeBtn').addEventListener('click', ()=> wrapper.remove());
}

function getPriceRange(tags) {
  const priceTag = tags.find(t => t.includes('₹'));
  if (!priceTag) return null;

  const match = priceTag.match(/₹(\d+)-(\d+)L/);
  if (!match) return null;

  return {
    low: parseInt(match[1]),
    high: parseInt(match[2])
  };
}


renderCards();

